import logo from './logo.svg';
import './App.css';
import Header from './components/Header';

function App() {
  return (
   <div>
    <Header />

    {/* HERO SECTION */}
    <div>
      <video src={process.env.PUBLIC_URL + '/accpaivideo.mp4'} preload="auto" loop poster={process.env.PUBLIC_URL + '/1063×680-01.jpg'} autoplay />
    </div>
   </div>
  );
}

export default App;
